import React from "react";
import { MDBBtn, MDBContainer } from "mdb-react-ui-kit";


import { MDBCarousel, MDBCarouselInner, MDBCarouselItem, MDBRow, MDBCol, MDBCard, MDBCardImage, MDBCardBody, MDBCardTitle, MDBCardText } from "mdb-react-ui-kit";
const CardCarousel = () => {
  return (
    <MDBCarousel activeItem={1} length={3} showControls showIndicators className="z-depth-1">
      <MDBCarouselInner>
        <MDBCarouselItem itemId="1">
          <MDBRow className="row-cols-1 row-cols-md-3 g-4">
            <MDBCol>
              <MDBCard className="h-100">
                <MDBCardImage src="https://mdbcdn.b-cdn.net/img/new/standard/city/041.webp" alt="Hollywood Sign on The Hill" top hover
                  overlay="white-slight" />
                <MDBCardBody>
                  <MDBCardTitle>Card title</MDBCardTitle>
                  <MDBCardText>
                    This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.
                  </MDBCardText>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
            {/* Add more cards as needed */}
          </MDBRow>
        </MDBCarouselItem>
        {/* Add more carousel items as needed */}
      </MDBCarouselInner>
    </MDBCarousel>
  );
};

export default CardCarousel;

